import React from 'react';
const Header = () => {
    var link1 = document.getElementById("#link1");
    var link2 = document.getElementById("#link2");
    var link3 = document.getElementById("#link3");
    var link4 = document.getElementById("#link4");
    const links1 = () => {

        link1.classList.add("active");
        link2.classList.remove("active");
        link3.classList.remove("active");
        link4.classList.remove("active");

    };
    const links2 = () => {

        link1.classList.remove("active");
        link2.classList.add("active");
        link3.classList.remove("active");
        link4.classList.remove("active");

    }
    const links3 = () => {

        link1.classList.remove("active");
        link2.classList.remove("active");
        link3.classList.add("active");
        link4.classList.remove("active");

    };
    const links4 = () => {

        link1.classList.remove("active");
        link2.classList.remove("active");
        link3.classList.remove("active");
        link4.classList.add("active");

    };
    return (
        <nav className="navbar">
            <div className="container">
                <div className="nav-elements">
                    <ul className='menu'>
                        <li>
                            <a href="/" id='link1' className='nav-link active' onClick={links1}>Accueil</a>
                        </li>
                        <li>
                            <a href="/Galerie" id='link2' className='nav-link' onClick={links2}>Galerie</a>
                        </li>
                        <li>
                            <a href="/Tarifs_et_Prestations" id='link3' className='nav-link' onClick={links3}>tarifs et prestations</a>
                        </li>
                        <li>
                            <a href="/Contact" className='nav-link' id='link4' onClick={links4} >Contact</a>
                        </li>
                    </ul>
                </div>
            </div>
        </nav>
    )

}
export default Header
